No joke after I did the pink on my eyes I was like WTF did I just do 🤡... BUT with some fierce blending it actually came together beautifully 🙌🏼💖 obsessing over this @colourpopcosmetics x Sailor Moon collaboration 💫✨ My tip for this fun look:
1) TikTok made me buy this foundation but it’s good! Just sets really matte.

2) When in doubt just Blend! BLEND and be patient. I’m just now getting into fun bright colors but I’m still learning how to use them 😅

3) Makeup is supposed to be FUN so step out of that comfort zone and just give it a try! If it doesn’t workout just wash your face 🤷🏻‍♀️ Products I used in order:
@lorealparis Infallible Fountain 480

@colourpopcosmetics Blush in the shadeCats Eye 
@benefitcosmetics Highlight In the shade Tickle 
@colourpopcosmetics X Sailor Moon palette pretty guardian

@benefitcosmetics Roller Liner Eyeliner

@tartecosmetics Maneater Mascars (my favorite!) @lillylashes in the style Rome

@colourpopcosmetics gloss set in the shade Moonlight 
@tartecosmetics Stay Spray 🙌🏼 Hope you enjoy!!
#beauty #makeup #fun #colourpop #colourpopcosmetics #sailormoon #lillylashes #tartecosmetics #benefitcosmetics #girly #loreal #eyeshadow #sailorjupiter #benefitbrows

A few tips on this look:
• This palette is very pigmented so be ready to blend 🙌🏼👍🏼
• Do a skinny wing liner that is close to the lash line to open up your eye
• A soft glossy lip will keep your look fresh!

